import React from 'react';
import '../CartIcon/CartIcon';
import { CartIcon } from '../CartIcon/CartIcon';
import { Link } from 'react-router-dom';
import { Navbar, Container } from 'react-bootstrap';

export const NavBar = () => {
    return (
        <Container>
            <Navbar bg="light" expand="lg">
                <Navbar.Brand>
                    <Link to={"/"}>Inicio</Link>
                </Navbar.Brand>
                <CartIcon />
            </Navbar>
        </Container>

    );
};
